import React, {Component} from 'react';

class Footer extends Component {
    render() {
        return (
            <div Style="width:100%; height:120px; margin-top: 42px; border:outset; position: fixed; left: 0; bottom: 0;">

            </div>
        );
    }
}

export default Footer;
